from nicegui import app as app, ui
import os
from fastapi import Request
from fastapi.responses import RedirectResponse
from starlette.middleware.base import BaseHTTPMiddleware
from dotenv import load_dotenv
import sessions

import pages.login as login
import pages.root as root
import pages.admin as admin
import pages.clinician as clinician
import pages.patient as patient
import pages.dashboard as dashboard
import pages.account as account
import pages.settings as settings

import base64

load_dotenv()

admin_pages = {'/admin', '/clinician', 'settings', '/docs'}
clinician_pages = {'/dashboard', '/patient', '/'}
allowed_prefix = ('/_nicegui', '/assets')

class AuthMiddleware(BaseHTTPMiddleware):
    """This middleware restricts access to all NiceGUI pages.

    It redirects the user to the login page if they are not authenticated.
    """

    async def dispatch(self, request: Request, call_next):
        if not request.url.path.startswith(allowed_prefix):
            # logged in
            if app.storage.user.get('token', False):
                session = sessions.validate_session(token=app.storage.user.get('token'))
                
                if session == None:
                    app.storage.user.clear()
                    return RedirectResponse('/login')

                if session.account_type == "Admin" and request.url.path in clinician_pages:
                        return RedirectResponse('/admin')
                elif session.account_type == "Clinician" and request.url.path in admin_pages:
                        return RedirectResponse('/')
            # logged out
            else:
                if request.url.path != "/login":
                    return RedirectResponse('/login')
            
        return await call_next(request)


app.add_middleware(AuthMiddleware)

login.create()
root.create()
admin.create()
clinician.create()
patient.create()
dashboard.create()
account.create()
settings.create()

app.add_static_files('/assets', 'src/assets')


# um dont hate me
